    ordered_chars = [char for char in s if char in ordering_set]
    unordered_chars = [char for char in s if char not in ordering_set]
    ordered_chars.sort(key=ordering.index)
    return "".join(ordered_chars + unordered_chars)

def sort_string(s, ordering):
    ordering_set = ''.join(sorted(set(ordering), key=ordering.index))
    result = ''.join(char for char in s if char in ordering_set)
    result += ''.join(char for char in s if char not in ordering_set)
    return ''.join(sorted(result, key=ordering_set.index))

def sort_string(s, ordering):
    ordering = ''.join(c for i, c in enumerate(ordering) if c not in ordering[:i])
    result = ''.join(c for c in s if c in ordering)
    result += ''.join(c for c in s if c not in ordering)
    return ''.join(sorted(result, key=ordering.index))

def sort_string(s, ordering):
    ordering_set = "".join(dict.fromkeys(ordering))
    ordering_dict = {char: i for i, char in enumerate(ordering_set)}
    result = [''] * len(s)
    for char in s:
        if char in ordering_dict:
            result[ordering_dict[char]] = char
        else:
            result.append(char)
    return "".join(result)

def sort_string(s, ordering):
    ordering = ''.join(sorted(set(ordering), key=ordering.index))
    sorted_chars = sorted((c for c in s if c in ordering), key=ordering.index)
    remaining_chars = [c for c in s if c not in ordering]
    return ''.join(sorted_chars + remaining_chars)

def sort_string(s, ordering):
    ordering_set = "".join(dict.fromkeys(ordering))
    s_set = "".join(dict.fromkeys(s))
    result = ""
    for char in ordering_set:
        if char in s:
            result += char * s.count(char)
    for char in s:
        if char not in ordering_set:
            result += char
    return result

def sort_string(s, ordering):
    ordering_set = "".join(dict.fromkeys(ordering))
    result = ''.join(c for c in s if c in ordering_set)
    result += ''.join(c for c in s if c not in ordering_set)
    result_list = list(result)
    for i, c in enumerate(ordering):
        if c in result_list:
            result_list.remove(c)
            result_list.insert(i, c)
    return ''.join(result_list)

def sort_string(s, ordering):
    ordering_set = "".join(dict.fromkeys(ordering))  # Remove duplicate characters from the second string
    ordering_list = list(ordering_set)  # Convert the set to a list

    result = ""
    for char in ordering_list:
        result += char * s.count(char)  # Add characters from the first string that are in the second string, in order

    for char in s:
        if char not in ordering_set:
            result += char  # Add characters from the first string that are not in the second string, in original order

    return result
